import 'react-native-gesture-handler';
import { NativeBaseProvider, extendTheme } from 'native-base';
import * as React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import Products from './products';
import WishlistScreen from './Wishlist';
import WishData from './wishlist_data';
import Data from './data';
import { ContactStackNavigator } from "./StackNavigator";
import TabNavigator from "./TabNavigator";

const Drawer = createDrawerNavigator();


function MyDrawer() {
  return (
   
    <Drawer.Navigator >
      <Drawer.Screen name="Hoome" component={TabNavigator}   options={{
          headerStyle: {
            backgroundColor: '#f4511e',},
          headerTintColor: '#fff',
          paddingleft:120,
          headerTitleStyle: {
            fontWeight: 'bold',
          },
        }}/>
      <Drawer.Screen name="Coontact" component={ContactStackNavigator} />
      <Drawer.Screen name="Home" component={Products} />
      <Drawer.Screen name="Cart" component={Products} />
      <Drawer.Screen name="Wishlist" component={WishlistScreen} />
      <Drawer.Screen name="Wish-data" component={WishData} />
      <Drawer.Screen name="Notifications" component={WishlistScreen} />
      <Drawer.Screen name="Profile" component={Products} />
      <Drawer.Screen name="data" component={Data}  options={{ headerStyle: { backgroundColor: '#f4511e',}, headerTintColor: '#fff',paddingleft:120, headerTitleStyle: {fontWeight: 'bold',}, }}/>
    </Drawer.Navigator>
    
  );
}
export default function Dash_Admin() {
  return (
    <NativeBaseProvider>
        <MyDrawer />
    </NativeBaseProvider>
  );
}
